import React, { useState } from 'react'

function Filters({ handleFilter }) {
    const [category, setCategory] = useState('')

    return (
        <div className="filterContainer">
            <input type='checkbox' name='foodDrink'>Food N Drink</input>
            <input type='checkbox' name='home'>Home</input>
            <input type='checkbox' name='apparel'>Apparel</input>
            <input type='checkbox' name='entertainment'>Entertainment</input>
            <input type='checkbox' name='miscellaneous'>Miscellaneous</input>
        </div>
    )
}

export default Filters
